sys_variable_value.value:
(function execute(inputs, outputs) {
    
    // set script variables based on input paramters
    var type = inputs.type; //type of assessment
    var target_assessment = inputs.target_assessment; //target assessment table
    var target_reponse = inputs.target_response; //target response table
    var source_assessment = inputs.source_assessment; //source assessment template
    var parent = inputs.parent; //sys_id of record assessment is against
    var assessment_for = inputs.assessment_for; //table name of record the assessment is against
    var assessment_for_sys_id; //sys id of the table of record the assessment is against

    //query system objects for sys id of table
    var grAssessmentForTable = new GlideRecord('sys_db_object');
    grAssessmentForTable.addQuery('name',assessment_for);
    grAssessmentForTable.query();

    if (grAssessmentForTable.next()){
        assessment_for_sys_id = grAssessmentForTable.sys_id;
    }

    //get the assessment template record
    var grSourceAssessment = new GlideRecord(source_assessment);
    grSourceAssessment.addQuery('assessment_type', type);
    grSourceAssessment.addQuery('assessment_for', assessment_for_sys_id);
    grSourceAssessment.query();

    while (grSourceAssessment.next()){
        //create the assessment record against 
        var grTargetAssessment = new GlideRecord(target_assessment);
        grTargetAssessment.initialize();
        grTargetAssessment.case = parent;
        grTargetAssessment.template = grSourceAssessment.sys_id;
        grTargetAssessment.update();

        //get the questions template table name
        var source_questions = grSourceAssessment.questions_table.name;

        var helper = new sn_niem.AssessmentHelper();
        helper.createQtnRespFromAssessmentDefinition(source_questions,target_reponse,grTargetAssessment.sys_id, grSourceAssessment.sys_id);
    }
    
})(inputs, outputs);

